function Travdet(){
  const [places, setPlaces] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const cityName = "delhi"; // Replace with the city name provided by the user
      const apiKey = "5ae2e3f221c38a28845f05b6d63373a3a7200d5edd9e4bd581e3b7c3"; // Replace with your OpenTripMap API key

      try {
        const response = await fetch(
          `https://api.opentripmap.com/0.1/en/places/geoname?name=${cityName}&apikey=${apiKey}`
        );

        if (!response.ok) {
          throw new Error("Network response was not ok");
        }

        const data = await response.json();
        setPlaces(data.features);
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };

    fetchData();
  }, []); // Empty dependency array means this effect will only run once, similar to componentDidMount

  return (
    <div>
      <h1>Places in {places.length > 0 ? places[0].properties.name : ""}</h1>
      <ul>
        {places.map((place) => (
          <li key={place.properties.xid}>{place.properties.name}</li>
        ))}
      </ul>
    </div>
  );
};

export default Travdet;
